import { Box, Button, ButtonText, GluestackUIProvider, HStack, Text } from '@gluestack-ui/themed';
import FeatureCard from "./FeatureCard";

import { Motion } from "@legendapp/motion"
import { ScrollView, TouchableOpacity } from 'react-native-gesture-handler';

import Gradient from '../assets/Icons/Gradient';
import ResponsiveTimePickers from './ResponsiveTimePickers';





const ProfileScreen = ({navigation}: {navigation: any}) => {
    return(
        
        <Box flex={1} backgroundColor="#450d7a"> 
        <ScrollView
          style={{ height: '100%' }}
          contentContainerStyle={{ flexGrow: 1 }}
        >
          <Box
            position="absolute"
            $base-h={500}
            $base-w={500}
            $lg-h={700}
            $lg-w={700}
          >
            <Gradient />
          </Box>
          {/* <HomeScreen></HomeScreen> */}
          
        <Box
        height="20%"
        $base-my="$16"
        $base-mx="$5"

        $lg-my="$24"
        $lg-mx="$32"
        justifyContent="space-between"
        alignItems="center"
      >
        
        
          <Motion.View
                initial={{ opacity: 0 }}
                animate={{ opacity: 1}}
                whileHover={{ scale: 1.2 }}
                whileTap={{ y: 20 }}
                transition={{ duration: 1 }}
          >
            <Box justifyContent="center" alignItems="center">
             <Text color="$white" fontWeight="$medium" ml="$2" size="3xl">
                  Pick what times you are avalible each day.
              </Text>
              </Box>
          </Motion.View>

          <Box $base-flexDirection="column"  display="flex" gap="$11" $md-flexDirection="row">
          
            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
                <ButtonText>Monday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
                <ButtonText>Tuesday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
            <ButtonText>Wednesday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
            <ButtonText>Thursday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
            <ButtonText>Friday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
            <ButtonText>Saterday</ButtonText>
            </Button>

            <Button
            size="md"
            variant="solid"
            action="primary"
            isDisabled={false}
            isFocusVisible={false}
            >
            <ButtonText>Sunday</ButtonText>
            </Button>
          </Box>

         

          
          
        <ResponsiveTimePickers></ResponsiveTimePickers>
       
      </Box>
          
          
        </ScrollView>
      </Box>
    );
  };

  export default ProfileScreen;
